    public TblStudent InsertUser;
    [Parameter]
    public string id { get; set; }
    protected override void OnInitialized()
    {
        InsertUser = new TblStudent();
        GetStudentbyId();
        base.OnInitialized();
    }
    public void GetStudentbyId()
    {
        InsertUser= LoginService.StudentById(id);
    }

    public void StudentUpdate()
    {
        var result = LoginService.UpdateStudent(id,InsertUser);
        if (result)
        {
            StateHasChanged();
            navigate.NavigateTo("DashBoard");
        }
    }


